import { createRouter, createWebHashHistory } from "vue-router";
import Home from '../views/Home.vue';

Vue.use(VueRouter);

const routes = [
    {
      path: '/',
      name: 'Home',
      component: Home,
    },   
  ];

const router = new VueRouter({
    mode: 'history',
    base: process.env.BASE_URL,
    routes,
  });

  //설정한 VueRouter 내보낸다.
  export default router;
